import React from 'react'
import { useState } from 'react'
import Ability from './Ability'

const AbilityList = ( {abilities} ) => {
    return (
        <div>
            {abilities.map((a) => <Ability ability = {a}/>)}
        </div>
    )
}

export default AbilityList
